import styled from "styled-components";

export const Img = styled.img`
width: 100%;
height: 100%;
border-radius: 50%;
`;

export const Dropdown = styled.div`
height : 160px;
width : 160px;
display: none;
border-radius: 20px;
background:rgb(252, 245, 245);
`;
